    //   .then((data) => {
    //     setData(data);
    //     console.log(data);
    //   });
  }, []);

  return (
    <div>
      {typeof data.members === "undefined" ? (
        <p>Loading...</p>
      ) : (
        <>
          <p>{message}</p>
          {data.members.map((member, i) => (
            <p key={i}> {member}</p>
          ))}
        </>
      )}
    </div>
  );
}

export default App;
